/** 
 * Parses a JSON string into an  {@code RtpPacketStreamDump}. <p>The input JSON must include the following key-value pairs: <ul> <li>Key: "trackName", Value type: String. The name of the RTP track. <li>Key: "firstSequenceNumber", Value type: int. The sequence number of the first RTP packet in the dump file. <li>Key: "firstTimestamp", Value type: long. The timestamp of the first RTP packet in the dump file. <li>Key: "transmissionIntervalMs", Value type: long. The interval between transmitting two consecutive RTP packets, in milliseconds. <li>Key: "mediaDescription", Value type: String. The description of the dumped media in SDP(RFC2327) format. <li>Key: "packets", Value type: Array of hex strings. Each element is a hex string representing an RTP packet's binary data. </ul>
 * @param jsonString The JSON string that contains the dumped RTP packets and metadata.
 * @return The parsed {@code RtpDumpFile}.
 * @throws ParserException If the argument does not contain all required key-value pairs, or thereare incorrect values.
 */
public static RtpPacketStreamDump parse(String jsonString) throws ParserException {
  try {
    JSONObject jsonObject=new JSONObject(jsonString);
    String trackName=jsonObject.getString("trackName");
    int firstSequenceNumber=jsonObject.getInt("firstSequenceNumber");
    long firstTimestamp=jsonObject.getLong("firstTimestamp");
    long transmissionIntervalMs=jsonObject.getLong("transmitIntervalMs");
    String mediaDescription=jsonObject.getString("mediaDescription");
    ImmutableList.Builder<String> packetsBuilder=new ImmutableList.Builder<>();
    JSONArray jsonPackets=jsonObject.getJSONArray("packets");
    for (int i=0; i < jsonPackets.length(); i++) {
      packetsBuilder.add(jsonPackets.getString(i));
    }
    return new RtpPacketStreamDump(trackName,firstSequenceNumber,firstTimestamp,transmissionIntervalMs,mediaDescription,packetsBuilder.build());
  }
 catch (  JSONException e) {
    throw ParserException.createForMalformedManifest(null,e);
  }
}

